import React from "react";
import CloneHeader from "./CloneHeader";
import CloneNote from "./CloneNote";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";


const Clone = () => {
    return (
        <>
            <CloneHeader/>
            <CloneNote/>
        </>
    );
}

export default Clone;
